import React, { useState } from 'react'
import '../styles.css'
import ChooseCharts from '../chooseCharts/ChooseCharts'
import ChooseDataset from '../chooseDataset/ChooseDataset'
import { useLocation } from 'react-router-dom'

const OverviewPage = (props) => {
  const [boxPlotData, setBoxPlotData] = useState({})
  const [wordCloudData, setWordCloudData] = useState({})
  const [timeLineData, setTimeLineData] = useState({})
  const [sunburstData, setSunburstData] = useState({})
  const [sunburstLabel, setSunburstLabel] = useState({})
  const [eventTypeColor, setEventTypeColor] = useState({})

  const location = useLocation()
  const receivedData = location.state?.receivedData || []
  const myDataset = location.state?.dataset || []

  console.log('Received data in Overview:', receivedData)
  console.log('My Dataset:', myDataset)
  const handleDataReceived = (data) => {
    console.log('Dados recebidos:', data)
    setBoxPlotData(data)
  }

  return (
    <div className="container-fluid" style={{ paddingTop: '20px' }}>
      <div className="row">
        <div className="col-md-8">
          <div
            className="first-div"
            style={{
              padding: '30px',
              marginBottom: '20px',
              background: '#4D5859',
            }}
          ></div>
        </div>
        <div
          className="col-md-4"
          style={{ display: 'flex', justifyContent: 'flex-end' }}
        >
          <div
            className="first-div"
            style={{
              height: '520px',
              padding: '30px',
              marginBottom: '20px',
              background: '#4D5859',
              alignItems: 'center',
              justifyContent: 'center',
              textAlign: 'center',
            }}
          ></div>
        </div>
      </div>
      <div
        className="row"
        style={{ display: 'flex', justifyContent: 'center' }}
      >
        <div className="col-md-4">
          <div
            className="first-div"
            style={{
              padding: '30px',
              marginBottom: '20px',
              background: '#4D5859',
              alignItems: 'center',
              justifyContent: 'center',
              textAlign: 'center',
            }}
          ></div>
        </div>
        <div className="col-md-4" style={{ height: '640px' }}>
          <div
            className="first-div"
            style={{
              padding: '30px',
              marginBottom: '20px',
              background: '#4D5859',
              alignItems: 'center',
              justifyContent: 'center',
              textAlign: 'center',
            }}
          ></div>
        </div>
        <div className="col-md-4">
          <div
            className="first-div"
            style={{
              padding: '30px',
              marginBottom: '20px',
              background: '#4D5859',
              alignItems: 'center',
              justifyContent: 'center',
              textAlign: 'center',
            }}
          ></div>
        </div>
      </div>
    </div>
  )
}

export default OverviewPage
